/*
Press [SPACE] to clear the drawing board
Draw with the mouse inside the leftmost black square
Drawing while holding [SHIFT] erases instead

All other squares are outputs of the convolutionnal layers
The strip above the digits is the output of the linear layer before softmax
The strip with the yellow separators is the final output of the network (after softmax)
The strip at the bottom of the screen is Buffer A at original scale (all other areas are scaled-up from it)

Neural net weigths are exported from a (dirty) Python/PyTorch script to the "Common" tab
Neural net logic is defined in the "Buffer A" tab

You should have at least 640x360 pixels to display everything

The neural network is made of the following layers :
INPUT : 1 channel * 28x28 pixels
sigmoid(conv2d(kernel_size=3, out_channels=3, stride=2, padding=0)) -> OUT : 3 channels * 13x13 pixels
sigmoid(conv2d(kernel_size=3, out_channels=3, stride=2, padding=0)) -> OUT : 3 channels * 6x6 pixels
sigmoid(conv2d(kernel_size=3, out_channels=3, stride=1, padding=0)) -> OUT : 3 channels * 4x4 pixels
softmax(linear(out_dim=10))
It was trained on MNIST using rudimentary data augmentation, reaching around 96.5% accuracy on the test dataset
(softmax was not used during training)

I've limited the network to 3 output channels at each conv layer in order to easily store and display it
*/

//#define DEBUG

#define INRECT(q, X, Y, W, H) q.x >= X && q.x < X+W && q.y >= Y && q.y < Y+H
#define GETMAPPED(channel, outvar, Xin, Yin, Win, Hin, Xout, Yout, Wout, Hout) \
    inRect = INRECT(fragCoord, Xin, Yin, Win, Hin); \
    if(inRect) outvar = texelFetch(channel, ivec2((fragCoord-vec2(Xin,Yin))/vec2(Win, Hin)*vec2(Wout,Hout)+vec2(Xout,Yout)), 0);

#define MAP(channel, Xin, Yin, Win, Hin, Xout, Yout, Wout, Hout) \
    inRect = INRECT(fragCoord, Xin, Yin, Win, Hin); \
    if(inRect) fragColor = texelFetch(channel, ivec2((fragCoord-vec2(Xin,Yin))/vec2(Win, Hin)*vec2(Wout,Hout)+vec2(Xout,Yout)), 0);

#define MAPBIS(channel, Xin, Yin, Win, Hin, Xout, Yout, Wout, Hout) \
    for(int i = 0; i<3; i++) { \
        float Xin_small = Xin+float(i%2)*Win/2.0; \
        float Yin_small = Yin+floor(float(i)/2.0)*Hin/2.0; \
        inRect = INRECT(fragCoord, Xin_small, Yin_small, Win/2.0, Hin/2.0); \
        if(inRect) { \
            fragColor = texelFetch(channel, ivec2((fragCoord-vec2(Xin_small,Yin_small))/vec2(Win/2.0, Hin/2.0)*vec2(Wout,Hout)+vec2(Xout,Yout)), 0); \
            fragColor.rgb = vec3(fragColor[i]); \
        } \
    }


void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = fragCoord/iResolution.xy;

    // Time varying pixel color
    vec3 col = 0.5 + 0.5*cos(iTime/10.0+uv.xyx+vec3(0,2,4));

    fragColor = vec4(vec3(0.2,0.3,0.4)+0.2*(col),1.0);

    // Output to screen
    #ifdef DEBUG
    if (fragCoord.y <= 40.0) {
        fragColor = texelFetch(iChannel0, ivec2(fragCoord), 0);
    }
    #endif

    bool inRect;
    float xScale = iResolution.y/360.0;
    float yScale = iResolution.y/360.0;

    MAP(iChannel0, 50.0*xScale, 200.0*yScale, 100.0*xScale, 100.0*yScale, 10.0, 10.0, 28.0, 28.0)

    #ifndef ALTERNATE
        MAP(iChannel0, 200.0*xScale, 200.0*yScale, 100.0*xScale, 100.0*yScale, 60.0, 10.0, 13.0, 13.0)

        MAP(iChannel0, 350.0*xScale, 200.0*yScale, 100.0*xScale, 100.0*yScale, 120.0, 10.0, 6.0, 6.0)

        MAP(iChannel0, 500.0*xScale, 200.0*yScale, 100.0*xScale, 100.0*yScale, 181.0, 11.0, 4.0, 4.0)
    #else
        MAP(iChannel0, 175.0*xScale, 200.0*yScale, 100.0*xScale, 100.0*yScale, 60.0, 10.0, 26.0, 26.0)

        MAP(iChannel0, 300.0*xScale, 200.0*yScale, 100.0*xScale, 100.0*yScale, 120.0, 10.0, 13.0, 13.0)

        MAP(iChannel0, 425.0*xScale, 200.0*yScale, 100.0*xScale, 100.0*yScale, 141.0, 11.0, 11.0, 11.0)

        MAP(iChannel0, 550.0*xScale, 200.0*yScale, 60.0*xScale, 60.0*yScale, 180.0, 10.0, 5.0, 5.0)
    #endif

    #ifndef TWOLINEARS
        MAP(iChannel0, 50.0*xScale, 125.0*yScale, 500.0*xScale, 50.0*yScale, 240.0, 5.0, 10.0, 1.0)
    #else
        MAP(iChannel0, 50.0*xScale, 160.0*yScale, 500.0*xScale, 25.0*yScale, 240.0, 5.0, 8.0, 1.0)
        MAP(iChannel0, 50.0*xScale, 125.0*yScale, 500.0*xScale, 25.0*yScale, 240.0, 10.0, 10.0, 1.0)
    #endif

    MAP(iChannel0, 50.0*xScale, 50.0*yScale, 500.0*xScale, 50.0*yScale, 300.0, 5.0, 10.0, 1.0)

    //Digits
    MAP(iChannel1, 50.0*xScale, 100.0*yScale, 500.0*xScale, 25.0*yScale, 0.0, 12.0*64.0, 10.0*64.0, 64.0)
    if(inRect) fragColor.rgb = vec3(fragColor.r);


    #ifdef DEBUG
    //For finding keycodes
    if(fragCoord.y >= 340.0*yScale && floor(fragCoord.x / iResolution.y * 255.0) == 16.0 ) fragColor.g=1.0;
    MAP(iChannel2, 0.0*xScale, 350.0*yScale, 640.0*xScale, 10.0*yScale, 0.0, 0.0, 255.0, 3.0);
    /**/
    #endif


    if (fragCoord.x >= 50.0*xScale && fragCoord.x <= 555.0*xScale && mod(fragCoord.x/xScale-50.0, 50.0) < 5.0 && fragCoord.y >= 50.0*yScale && fragCoord.y <= 100.0*yScale) {
        fragColor = vec4(1.0,1.0,0.0,1.0);
    }
}

//Transforms `q`'s coordinates to make the `in` region fit into the `out` region by scaling and translating
#define MAP(q, Xin, Yin, Win, Hin, Xout, Yout, Wout, Hout) \
    (q-vec2(Xin,Yin))/vec2(Win, Hin)*vec2(Wout,Hout)+vec2(Xout,Yout)

//Boolean expression to test if `q` is in the region defined by `X,Y,W,H`
#define INRECT(q, X, Y, W, H) q.x >= X && q.x < X+W && q.y >= Y && q.y < Y+H

//Was used for debugging positions
#define COPY(layer, bias, in_channels, stride, input_pos, output_pos, input_size) \
    if (INRECT(fragCoord, output_pos.x, output_pos.y, input_size.x/stride, input_size.y/stride)) { \
        ivec2 inputPos = ivec2(vec2(MAP(fragCoord, output_pos.x, output_pos.y, input_size.x/stride, input_size.y/stride, input_pos.x, input_pos.y, input_size.x, input_size.y))); \
        fragColor = texelFetch(iChannel0, inputPos, 0); \
    } 

//Always 3 ouput channels
//`layer` is an array of mat3 of size (3*in_channels). Each mat3 is a conv kernel, in increasing order of out_channel+in_channels*in_channel
//`bias` is a vec3
//`in_channels` is the number of input channels as an int
//`stride is an int
//
//Beware of dark magic related to converting between pytorch & glsl coordinate systems
#define CONV(layer, bias, in_channels, stride, input_pos, output_pos, input_size) \
    if (INRECT(fragCoord, output_pos.x, output_pos.y, input_size.x/stride, input_size.y/stride)) { \
        ivec2 inputPixel = ivec2(vec2(MAP(fragCoord, output_pos.x, output_pos.y, input_size.x/stride, input_size.y/stride, input_pos.x, input_pos.y, input_size.x, input_size.y))); \
        vec4 outColor = vec4(0.0,0.0,0.0,0.0); \
        for(int x=-1; x<=1; x++) { \
            for(int y=-1; y<=1; y++) { \
                for(int k=0; k<in_channels; k++) { \
                    vec4 inputColor = texelFetch(iChannel0, inputPixel+ivec2(y,-x), 0); \
                    outColor+= inputColor[k] * vec4(layer[0*in_channels+k][x+1][y+1], layer[1*in_channels+k][x+1][y+1], layer[2*in_channels+k][x+1][y+1], 1.0); \
                } \
            } \
        } \
        fragColor = 1.0 / (1.0 + exp(-1.0 * (outColor + vec4(bias, 0.0)))); \
    } \


// Value used below to convert between arbitrary floats and values in the range [0.0,1.0]
// (needed to store arbitrary values from the linear layer's output in the texture)
#define SCALE_VALUES 50.0

//Compute ONE output of a linear layer (must be repeated for each output)
//Did not find a workaround for the lack of 2D array :(
//`numOut` is the indice of the output
//`weights` is an array of floats in increasing order of `y+input_size.y*x+input_size.y*input_size.x*channel`
//Output is a single pixel, at `output_pos + vec2(numOut,0)` 
//
//Beware of dark magic related to converting between pytorch & glsl coordinate systems

#define LINEAR(numOut, weights, bias, input_pos, output_pos, input_size) \
        if (ivec2(fragCoord) == ivec2(output_pos.x+numOut, output_pos.y)) { \
            vec4 outColor=vec4(0.0,0.0,0.0,1.0); \
            vec4 ones=vec4(1.0,1.0,1.0,0.0); \
            for(int y=0; y<int(input_size.y); y++) { \
                for (int x=0; x<int(input_size.x) ; x++) { \
                    vec4 inputColor = texelFetch(iChannel0, ivec2(input_pos)+ivec2(y,input_size.x-1-x), 0); \
                    for (int c=0; c<3; c++) { \
                        outColor+= weights[y+input_size.y*x+input_size.y*input_size.x*c] * inputColor[c] * ones; \
                    }\
                } \
            } \
            fragColor = ((outColor + bias[numOut])+SCALE_VALUES/2.0)/SCALE_VALUES; \
        } \

#define LINEAR1(numOut, weights, bias, input_pos, output_pos, input_size) \
        if (ivec2(fragCoord) == ivec2(output_pos.x+numOut, output_pos.y)) { \
            vec4 outColor=vec4(0.0,0.0,0.0,1.0); \
            vec4 ones=vec4(1.0,1.0,1.0,0.0); \
            for(int y=0; y<int(input_size.y); y++) { \
                for (int x=0; x<int(input_size.x) ; x++) { \
                    vec4 inputColor = texelFetch(iChannel0, ivec2(input_pos)+ivec2(x,0), 0); \
                    outColor+= weights[y+input_size.y*x] * inputColor[0] * ones; \
                } \
            } \
            fragColor = ((outColor + bias[numOut])+SCALE_VALUES/2.0)/SCALE_VALUES; \
        } \

#define LINEAR_SIGMOID(numOut, weights, bias, input_pos, output_pos, input_size) \
        if (ivec2(fragCoord) == ivec2(output_pos.x+numOut, output_pos.y)) { \
            vec4 outColor=vec4(0.0,0.0,0.0,1.0); \
            vec4 ones=vec4(1.0,1.0,1.0,0.0); \
            for(int y=0; y<int(input_size.y); y++) { \
                for (int x=0; x<int(input_size.x) ; x++) { \
                    vec4 inputColor = texelFetch(iChannel0, ivec2(input_pos)+ivec2(y,input_size.x-1-x), 0); \
                    for (int c=0; c<3; c++) { \
                        outColor+= weights[y+input_size.y*x+input_size.y*input_size.x*c] * inputColor[c] * ones; \
                    }\
                } \
            } \
            fragColor = 1.0 / (1.0 + exp(-1.0 * (outColor + bias[numOut]))); \
        } \


//Conserves size and shape of input, but scales values using softmax on the input region
#define SOFTMAX(input_pos, output_pos, input_size) \
    if (INRECT(fragCoord, output_pos.x, output_pos.y, float(input_size.x), float(input_size.y))) { \
        float result = 0.0; \
        float sum = 0.0; \
        vec2 inputCoord = fragCoord + vec2(input_pos) - output_pos; \
        float val = exp(texelFetch(iChannel0, ivec2(inputCoord), 0)[0]*SCALE_VALUES-SCALE_VALUES/2.0); \
        vec4 ones=vec4(1.0,1.0,1.0,0.0); \
        for(int y=0; y<int(input_size.y); y++) { \
            for (int x=0; x<int(input_size.x) ; x++) { \
                sum+= exp(texelFetch(iChannel0, input_pos+ivec2(x,y), 0)[0]*SCALE_VALUES-SCALE_VALUES/2.0); \
            } \
        } \
        fragColor = (val/sum)*ones; \
        fragColor.a = 1.0; \
    } \

#define keypressed(ascii) ( texelFetch(iChannel1,ivec2(ascii,0),0).x > 0. )

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    //Preserve state from previous frame
    fragColor = texelFetch(iChannel0, ivec2(fragCoord), 0);


    float pixScale = iResolution.y/360.0;

    bool shiftPressed = keypressed(16);
    //Drawing with the mouse in the leftmost square
    if(INRECT(iMouse.xy, 50.0*pixScale, 200.0*pixScale, 100.0*pixScale, 100.0*pixScale) 
       && length(MAP(iMouse.xy, 50.0*pixScale, 200.0*pixScale, 100.0*pixScale, 100.0*pixScale, 10.0, 10.0, 28.0, 28.0) - fragCoord) < 1.15 && iMouse.z > 0.5) {
        if(!shiftPressed) fragColor = vec4(1.0);
        else fragColor = vec4(0.0);
    }

    //Init - pre-drawn 8 digit
    if (iFrame==0) {
        float d1 = length(fragCoord-vec2(22.0, 18.0));
        float d2 = length(fragCoord-vec2(22.0, 30.0));
        if(d1>=4.0 && d1<=6.5) fragColor=vec4(1.0);
        if(d2>=3.50 && d2<=6.0) fragColor=vec4(1.0);
    }
    bool spacePressed = texture(iChannel1,  vec2(0.126953125, .25)).x > 0.;
    if(spacePressed) fragColor=vec4(0.0,0.0,0.0,1.0);

    //Neural network
    #ifndef ALTERNATE
        CONV(layer0,bias0,1,2.0,vec2(10.0,10.0),vec2(60.0,10.0),vec2(28.0,28.0));
        CONV(layer2,bias2,3,2.0,vec2(60.0,10.0),vec2(120.0,10.0),vec2(13.0,13.0));
        CONV(layer4,bias4,3,1.0,vec2(120.0,10.0),vec2(180.0,10.0),vec2(6.0,6.0));
        LINEAR(0, linear0, linearbias, ivec2(181, 11), ivec2(240, 5), ivec2(4,4));
        LINEAR(1, linear1, linearbias, ivec2(181, 11), ivec2(240, 5), ivec2(4,4));
        LINEAR(2, linear2, linearbias, ivec2(181, 11), ivec2(240, 5), ivec2(4,4));
        LINEAR(3, linear3, linearbias, ivec2(181, 11), ivec2(240, 5), ivec2(4,4));
        LINEAR(4, linear4, linearbias, ivec2(181, 11), ivec2(240, 5), ivec2(4,4));
        LINEAR(5, linear5, linearbias, ivec2(181, 11), ivec2(240, 5), ivec2(4,4));
        LINEAR(6, linear6, linearbias, ivec2(181, 11), ivec2(240, 5), ivec2(4,4));
        LINEAR(7, linear7, linearbias, ivec2(181, 11), ivec2(240, 5), ivec2(4,4));
        LINEAR(8, linear8, linearbias, ivec2(181, 11), ivec2(240, 5), ivec2(4,4));
        LINEAR(9, linear9, linearbias, ivec2(181, 11), ivec2(240, 5), ivec2(4,4));
        SOFTMAX(ivec2(240,5), vec2(300.0,5.0), ivec2(10,1));
    #else
        CONV(layer0,bias0,1,1.0,vec2(10.0,10.0),vec2(60.0,10.0),vec2(28.0,28.0));
        CONV(layer2,bias2,3,2.0,vec2(61.0,11.0),vec2(120.0,10.0),vec2(26.0,26.0));
        CONV(layer4,bias4,3,1.0,vec2(120.0,10.0),vec2(140.0,10.0),vec2(13.0,13.0));
        CONV(layer6,bias6,3,2.0,vec2(141.0,11.0),vec2(180.0,10.0),vec2(11.0,11.0));

        #ifndef TWOLINEARS
            LINEAR(0, linear0_0, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR(1, linear0_1, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR(2, linear0_2, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR(3, linear0_3, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR(4, linear0_4, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR(5, linear0_5, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR(6, linear0_6, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR(7, linear0_7, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR(8, linear0_8, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR(9, linear0_9, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            SOFTMAX(ivec2(240,5), vec2(300.0,5.0), ivec2(10,1));
        #else
            LINEAR_SIGMOID(0, linear0_0, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR_SIGMOID(1, linear0_1, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR_SIGMOID(2, linear0_2, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR_SIGMOID(3, linear0_3, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR_SIGMOID(4, linear0_4, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR_SIGMOID(5, linear0_5, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR_SIGMOID(6, linear0_6, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));
            LINEAR_SIGMOID(7, linear0_7, linearbias0, ivec2(180, 10), ivec2(240, 5), ivec2(5,5));

            LINEAR1(0, linear2_0, linearbias2, ivec2(240, 5), ivec2(240, 10), ivec2(8,1));
            LINEAR1(1, linear2_1, linearbias2, ivec2(240, 5), ivec2(240, 10), ivec2(8,1));
            LINEAR1(2, linear2_2, linearbias2, ivec2(240, 5), ivec2(240, 10), ivec2(8,1));
            LINEAR1(3, linear2_3, linearbias2, ivec2(240, 5), ivec2(240, 10), ivec2(8,1));
            LINEAR1(4, linear2_4, linearbias2, ivec2(240, 5), ivec2(240, 10), ivec2(8,1));
            LINEAR1(5, linear2_5, linearbias2, ivec2(240, 5), ivec2(240, 10), ivec2(8,1));
            LINEAR1(6, linear2_6, linearbias2, ivec2(240, 5), ivec2(240, 10), ivec2(8,1));
            LINEAR1(7, linear2_7, linearbias2, ivec2(240, 5), ivec2(240, 10), ivec2(8,1));
            LINEAR1(8, linear2_8, linearbias2, ivec2(240, 5), ivec2(240, 10), ivec2(8,1));
            LINEAR1(9, linear2_9, linearbias2, ivec2(240, 5), ivec2(240, 10), ivec2(8,1));
            SOFTMAX(ivec2(240,10), vec2(300.0,5.0), ivec2(10,1));
        #endif

    #endif
}
